const request = require('supertest')
import express from 'express'
import Router from '../main'
import { GenerateAccessToken } from '../../util/auth'

const app = express()
app.use(express.json())
app.use('/', Router)

let base64String = "";

describe('The Business Post Route Handler', function () {
    test('Creates a new business post', async () => {
        const authToken = await GenerateAccessToken(2, '', '')
        const res = await request(app)
            .post('/businessPosts')
            .set({ Authorization: `Bearer ${authToken}` })
            .send({
                picture: base64String,
                caption: "Hello World!",
                location: "Sydney, Australia",
                dateTime: "2022-02-09 00:00:00"
			});

        expect(res.statusCode).toBe(200);
        // expect(JSON.parse(res.text).data).toHaveProperty('email');
        expect(JSON.parse(res.text).data.verified).toBe(1);
    })
})

describe('The View Business Post Route Handler', function () {
    test('Checks the details of an existing business post (individual)', async () => {
        const authToken = await GenerateAccessToken(2, '', '')
        const res = await request(app)
            .get('/viewBusinessPosts/1')
            .set({ Authorization: `Bearer ${authToken}` })
            .send({ post_id: 1 });;

        expect(res.statusCode).toBe(200);
        expect(JSON.parse(res.text)).toHaveProperty('post');
        // expect(JSON.parse(res.text).data.verified).toBe(1);
    })

    test('Checks the details of an existing business post', async () => {
        const authToken = await GenerateAccessToken(2, '', '')
        const res = await request(app)
            .get('/viewBusinessPosts')
            .set({ Authorization: `Bearer ${authToken}` });

        expect(res.statusCode).toBe(200);
        expect(JSON.parse(res.text)).toHaveProperty('post');
    })
})
